// src/App.js
import React from 'react';
import Sidebar from './components/Sidebar';
import BookSection from './components/BookSection';
import books from './components/Books'; // Import the books data
import './App.css';  // Add global styles for layout

function App() {
  return (
    <div className="app">
      <Sidebar />
      <div className="content">
        <h1>Home</h1>
        <BookSection title="The Collection" books={books} /> {/* Pass the books to BookSection */}
      </div>
    </div>
  );
}

export default App;
